@Styromaniac: a while back i had a coffee spill accident and i had no idea some had gone into the port. i usually use the wireless charger but i went to use the connector and the phone discharged rapidly instead.
there was corrosion, i used a acidic cleaner like those for cleaning brass and copper with a earbud to clean the contacts.

check for corrosion, i dont know your environment but where i am the air has a kind of dust that gets sticky and humidity collects to it and causes corrosion.
